import React from 'react';
import styled from 'styled-components';

const StyledSlideOne = styled.div`
  .image-wrapper {
    height: 80vh;
    width: auto;
    padding-top: 5vh;

    img {
      height: 100%;
    }
  }
  .background-top {
    background: #FAC943;
    width: 100%;
    height: 80vh;
  }
  .background-bottom {
    background: #FFFFFF;
    width: 100%;
    height: 20vh;
  }
`;

function SlideOne() {
  return (
    <StyledSlideOne>
      <div className='image-wrapper'>
        <img src='images/app_screen_4.png'/>
      </div>
      <div className='background-top'/>
      <div className='background-bottom' />
    </StyledSlideOne>
  );
}

export default SlideOne;
